
-- CHANGED BY: António Neto
-- CHANGE DATE: 05/04/2011 09:09
-- CHANGE REASON: [ALERT-170607] Issue Replication: [2.6.1] Correction of bed status and bed action status
DECLARE
    l_bmng_action bmng_action%ROWTYPE;
    l_date_update TIMESTAMP(6)
        WITH LOCAL TIME ZONE;
BEGIN

    FOR item IN (SELECT DISTINCT
                        tmp.incoherent,
                        tmp.id_bed,
                        tmp.id_bmng_action,
			tmp.dt_begin_action
                   FROM (SELECT CASE
                                     WHEN ba.id_bmng_action IS NULL THEN
                                      -1
                                     WHEN ba.flg_bed_status <> 'B'
                                          AND bab.id_bmng_allocation_bed IS NULL THEN
                                      -2
                                     WHEN ba.flg_bed_status <> 'B'
                                          AND bab.id_bmng_allocation_bed IS NOT NULL
                                          AND bab.flg_outdated = 'Y' THEN
                                      -3
                                     WHEN ba.flg_bed_status = 'B' THEN
                                      0
                                     WHEN ba.flg_bed_ocupacity_status = 'O'
                                          AND bab.id_bmng_allocation_bed IS NOT NULL THEN
                                      0
                                 END incoherent,
                                bab.id_episode,
                                nvl(bab.update_user, bab.create_user) bab_uu,
                                bed.id_bed,
                                ba.id_bmng_action,
																ba.dt_begin_action
                           FROM bed
                           LEFT OUTER JOIN bmng_action ba ON bed.id_bed = ba.id_bed
                                                               AND ba.flg_status = 'A'
                           LEFT OUTER JOIN bmng_allocation_bed bab ON ba.id_bmng_allocation_bed =
                                                                            bab.id_bmng_allocation_bed
                          WHERE bed.flg_available = 'Y'
                            AND bed.flg_status = 'O'
                            AND bed.flg_type = 'P'
                          ORDER BY 1 NULLS FIRST) tmp
                   LEFT OUTER JOIN bmng_allocation_bed bab1 ON tmp.id_episode = bab1.id_episode
                                                                 AND bab1.flg_outdated = 'N'
                                                                 AND tmp.id_bed <> bab1.id_bed
                   LEFT OUTER JOIN bmng_action ba1 ON bab1.id_bmng_allocation_bed = ba1.id_bmng_allocation_bed
                                                        AND ba1.flg_status = 'A'
                  WHERE tmp.incoherent < 0
                  ORDER BY 1 NULLS LAST)
    LOOP

        CASE
            WHEN item.incoherent IN (-2, -3) THEN
                IF NOT item.dt_begin_action IS NOT NULL
                THEN
                    l_date_update := item.dt_begin_action;
                ELSE
                    l_date_update := current_timestamp;
                END IF;

                SELECT ba.*
                  INTO l_bmng_action
                  FROM bmng_action ba
                 WHERE ba.id_bmng_action = item.id_bmng_action;

                SELECT MAX(ba.id_bmng_action) + 1
                  INTO l_bmng_action.id_bmng_action
                  FROM bmng_action ba;

                l_bmng_action.id_bmng_reason           := NULL;
                l_bmng_action.id_bmng_reason_type      := 5;
                l_bmng_action.flg_status               := 'A';
                l_bmng_action.flg_action               := 'V';
                l_bmng_action.flg_bed_ocupacity_status := 'V';
                l_bmng_action.dt_creation              := l_date_update;
                l_bmng_action.dt_begin_action          := l_date_update;
                l_bmng_action.dt_end_action            := NULL;
                --

                UPDATE bmng_action ba
                   SET ba.flg_status = 'O'
                 WHERE ba.id_bmng_action = item.id_bmng_action;
                --
                INSERT INTO bmng_action
                    (id_bmng_action,
                     id_department,
                     id_room,
                     id_bed,
                     id_bmng_reason,
                     id_bmng_reason_type,
                     id_bmng_allocation_bed,
                     flg_target_action,
                     flg_status,
                     flg_origin_action,
                     flg_bed_ocupacity_status,
                     flg_bed_status,
                     flg_bed_cleaning_status,
                     id_prof_creation,
                     dt_creation,
                     nch_capacity,
                     action_notes,
                     dt_begin_action,
                     dt_end_action,
                     flg_action)
                VALUES
                    (l_bmng_action.id_bmng_action,
                     l_bmng_action.id_department,
                     l_bmng_action.id_room,
                     l_bmng_action.id_bed,
                     l_bmng_action.id_bmng_reason,
                     l_bmng_action.id_bmng_reason_type,
                     l_bmng_action.id_bmng_allocation_bed,
                     l_bmng_action.flg_target_action,
                     l_bmng_action.flg_status,
                     l_bmng_action.flg_origin_action,
                     l_bmng_action.flg_bed_ocupacity_status,
                     l_bmng_action.flg_bed_status,
                     l_bmng_action.flg_bed_cleaning_status,
                     l_bmng_action.id_prof_creation,
                     l_bmng_action.dt_creation,
                     l_bmng_action.nch_capacity,
                     l_bmng_action.action_notes,
                     l_bmng_action.dt_begin_action,
                     l_bmng_action.dt_end_action,
                     l_bmng_action.flg_action);
                --
                UPDATE bed
                   SET bed.flg_status = 'V'
                 WHERE bed.id_bed = item.id_bed;
            ELSE
                l_date_update := current_timestamp;
                --
                UPDATE bed
                   SET bed.flg_status = 'V'
                 WHERE bed.id_bed = item.id_bed;
        END CASE;

    END LOOP;

END;
/

-- CHANGE END: António Neto


-- CHANGED BY: António Neto
-- CHANGE DATE: 05/04/2011 09:43
-- CHANGE REASON: [ALERT-170607] Issue Replication: [2.6.1] Correction of bed status and bed action status

DECLARE
    l_dt_end bmng_bed_ea.dt_end%TYPE;
BEGIN

    DELETE FROM bmng_bed_ea;

    FOR rec IN (SELECT ba.id_bmng_action,
                       bed.id_bed,
                       ba.dt_begin_action dt_begin,
                       ba.dt_end_action dt_end,
                       ba.id_bmng_reason_type,
                       ba.id_bmng_reason,
                       bab.id_episode,
                       bab.id_patient,
                       roo.id_room,
                       dep.id_admission_type,
                       roo.id_room_type,
                       bab.id_bmng_allocation_bed,
                       bed.id_bed_type,
                       dep.id_department,
                       ds.dt_discharge_schedule,
                       nvl(en.flg_type, decode(nl.id_nch_level, NULL, NULL, 'U')) flg_type,
                       ai.id_nch_level,
                       CASE
                            WHEN bab.id_bmng_allocation_bed IS NULL
                                 AND ba.flg_bed_status IN ('N', 'R') THEN
                             'V'
                            ELSE
                             nvl(ba.flg_bed_ocupacity_status, bed.flg_status)
                        END flg_bed_ocupacity_status,
                       CASE
                            WHEN bab.id_bmng_allocation_bed IS NULL
                                 AND ba.flg_bed_status IN ('N', 'R') THEN
                             'N'
                            ELSE
                             ba.flg_bed_status
                        END flg_bed_status,
                       ba.flg_bed_cleaning_status,
                       bed.flg_type flg_bed_type,
                       decode(ba.action_notes, NULL, 'N', 'Y') has_notes,
                       ba.flg_action
                  FROM bmng_action ba
                  LEFT JOIN bmng_allocation_bed bab ON (bab.id_bmng_allocation_bed = ba.id_bmng_allocation_bed AND
                                                       bab.flg_outdated = 'N')
                  LEFT JOIN epis_nch en ON (en.id_epis_nch = bab.id_epis_nch AND en.flg_status = 'A')
                  LEFT JOIN bed bed ON (ba.id_bed = bed.id_bed AND bed.flg_available = 'Y')
                  LEFT JOIN room roo ON (roo.id_room = bed.id_room AND roo.flg_available = 'Y')
                 INNER JOIN department dep ON (dep.id_department = ba.id_department AND dep.flg_available = 'Y')
                  LEFT JOIN discharge_schedule ds ON (ds.id_episode = bab.id_episode AND ds.flg_status = 'Y')
                  LEFT JOIN adm_request ar ON (ar.id_dest_episode = bab.id_episode)
                  LEFT JOIN adm_indication ai ON (ai.id_adm_indication = ar.id_adm_indication)
                  LEFT JOIN nch_level nl ON nl.id_previous = ai.id_nch_level
                 WHERE ba.flg_status = 'A'
                   AND instr(dep.flg_type, 'I') > 0)
    LOOP
        IF rec.flg_action = 'B'
           OR rec.flg_action = 'U'
           OR rec.flg_action = 'BT'
           OR rec.flg_action = 'UT'
        THEN
            l_dt_end := rec.dt_end;
        ELSE
            l_dt_end := NULL;
        END IF;

        INSERT INTO bmng_bed_ea
            (id_bmng_action,
             id_bed,
             dt_begin,
             dt_end,
             id_bmng_reason_type,
             id_bmng_reason,
             id_episode,
             id_patient,
             id_room,
             id_admission_type,
             id_room_type,
             id_bmng_allocation_bed,
             id_bed_type,
             dt_discharge_schedule,
             flg_allocation_nch,
             id_nch_level,
             flg_bed_ocupacity_status,
             flg_bed_status,
             flg_bed_cleaning_status,
             has_notes,
             flg_bed_type,
             id_department,
             dt_dg_last_update)
        VALUES
            (rec.id_bmng_action,
             rec.id_bed,
             rec.dt_begin,
             l_dt_end,
             rec.id_bmng_reason_type,
             rec.id_bmng_reason,
             rec.id_episode,
             rec.id_patient,
             rec.id_room,
             rec.id_admission_type,
             rec.id_room_type,
             rec.id_bmng_allocation_bed,
             rec.id_bed_type,
             rec.dt_discharge_schedule,
             rec.flg_type,
             rec.id_nch_level,
             rec.flg_bed_ocupacity_status,
             rec.flg_bed_status,
             rec.flg_bed_cleaning_status,
             rec.has_notes,
             rec.flg_bed_type,
             rec.id_department,
             current_timestamp);

    END LOOP;

    COMMIT;

END;
/


