-- CHANGED BY: António Neto
-- CHANGE DATE: 27/04/2011 14:47
-- CHANGE REASON: [ALERT-174894] Set bmng_action and bmng_allocation_bed to outdated for free beds - Interaction between INPATIENT and SCHEDULE not complete on function set_bed_management

DECLARE
    l_bmng_action    bmng_action%ROWTYPE;
    l_id_bmng_action PLS_INTEGER := 0;
    l_date_update    TIMESTAMP(6)
        WITH LOCAL TIME ZONE;
BEGIN

    SELECT MAX(ba.id_bmng_action) + 1
      INTO l_id_bmng_action
      FROM bmng_action ba;

    FOR item IN (SELECT DISTINCT ba.flg_bed_ocupacity_status,
                                 ba.flg_bed_status,
                                 bed.id_bed,
                                 CASE
                                      WHEN bab.flg_outdated = 'N' THEN
                                       bab.id_bmng_allocation_bed
                                      ELSE
                                       NULL
                                  END l_id_bmng_allocation_bed,
                                 ba.id_bmng_action,
                                 ba.dt_begin_action
                   FROM bed
                  INNER JOIN alert.bmng_action ba ON bed.id_bed = ba.id_bed
                                                 AND ba.flg_status = 'A'
                   LEFT OUTER JOIN alert.bmng_allocation_bed bab ON ba.id_bmng_allocation_bed =
                                                                    bab.id_bmng_allocation_bed
                  WHERE bed.flg_available = 'Y'
                    AND bed.flg_status = 'V'
                    AND bed.flg_type = 'P'
                    AND (ba.flg_bed_status IN ('B', 'R') OR
                        (ba.flg_bed_status IN ('N') AND ba.flg_bed_ocupacity_status = 'O'))
                  ORDER BY 1)
    LOOP
        IF item.l_id_bmng_allocation_bed IS NOT NULL
        THEN
            UPDATE bmng_allocation_bed bab
               SET bab.flg_outdated = 'Y'
             WHERE bab.id_bmng_allocation_bed = item.l_id_bmng_allocation_bed;
        END IF;

        IF NOT item.dt_begin_action IS NOT NULL
        THEN
            l_date_update := item.dt_begin_action;
        ELSE
            l_date_update := current_timestamp;
        END IF;

        SELECT ba.*
          INTO l_bmng_action
          FROM bmng_action ba
         WHERE ba.id_bmng_action = item.id_bmng_action;

        l_id_bmng_action                       := l_id_bmng_action + 1;
        l_bmng_action.id_bmng_action           := l_id_bmng_action;
        l_bmng_action.id_bmng_reason           := NULL;
        l_bmng_action.id_bmng_reason_type      := 5;
        l_bmng_action.flg_status               := 'A';
        l_bmng_action.flg_action               := 'V';
        l_bmng_action.flg_bed_ocupacity_status := 'V';
        l_bmng_action.dt_creation              := l_date_update;
        l_bmng_action.dt_begin_action          := l_date_update;
        l_bmng_action.dt_end_action            := NULL;
        l_bmng_action.flg_bed_status           := 'N';
        l_bmng_action.id_bmng_allocation_bed   := NULL;
        --

        UPDATE bmng_action ba
           SET ba.flg_status = 'O'
         WHERE ba.id_bmng_action = item.id_bmng_action;
        --
        INSERT INTO bmng_action
            (id_bmng_action,
             id_department,
             id_room,
             id_bed,
             id_bmng_reason,
             id_bmng_reason_type,
             id_bmng_allocation_bed,
             flg_target_action,
             flg_status,
             flg_origin_action,
             flg_bed_ocupacity_status,
             flg_bed_status,
             flg_bed_cleaning_status,
             id_prof_creation,
             dt_creation,
             nch_capacity,
             action_notes,
             dt_begin_action,
             dt_end_action,
             flg_action)
        VALUES
            (l_bmng_action.id_bmng_action,
             l_bmng_action.id_department,
             l_bmng_action.id_room,
             l_bmng_action.id_bed,
             l_bmng_action.id_bmng_reason,
             l_bmng_action.id_bmng_reason_type,
             l_bmng_action.id_bmng_allocation_bed,
             l_bmng_action.flg_target_action,
             l_bmng_action.flg_status,
             l_bmng_action.flg_origin_action,
             l_bmng_action.flg_bed_ocupacity_status,
             l_bmng_action.flg_bed_status,
             l_bmng_action.flg_bed_cleaning_status,
             l_bmng_action.id_prof_creation,
             l_bmng_action.dt_creation,
             l_bmng_action.nch_capacity,
             l_bmng_action.action_notes,
             l_bmng_action.dt_begin_action,
             l_bmng_action.dt_end_action,
             l_bmng_action.flg_action);
        --

    END LOOP;
EXCEPTION
    WHEN OTHERS THEN
        NULL;
END;
/

-- CHANGE END: António Neto

