-- CHANGE DATE: 11/05/2011 18:03
-- CHANGE REASON: [ALERT-178226] Fix problems for multiple preferences and many services/specialties - Inpatient - Indication for Admission - Admission Services / Clinical Services - Error when selected clinical services "null".
BEGIN

    FOR item IN (SELECT ai.id_adm_indication
                   FROM adm_indication ai
                   JOIN adm_ind_dep_clin_serv aidcs ON (ai.id_adm_indication = aidcs.id_adm_indication AND
                                                       aidcs.flg_pref = 'Y')

                  GROUP BY ai.id_adm_indication
                 HAVING COUNT(1) > 1)
    LOOP
        UPDATE adm_ind_dep_clin_serv aidcs
           SET aidcs.flg_pref = 'N'
         WHERE aidcs.id_adm_indication = item.id_adm_indication;

    END LOOP;

END;
/
