-- CHANGED BY: Ana Monteiro
-- CHANGE DATE: 23/07/2012 17:32
-- CHANGE REASON: [ALERT-236799] 
-- script para inserir todas as instituicoes existentes, na P1_DEST_INSTITUTION, com origem=destino (que existam na P1_SPEC_DEP_CLIN_SERV)
DECLARE
    CURSOR c_cur IS
    -- todas as instituicoes q existem para referenciar
        SELECT DISTINCT d.id_institution
          FROM p1_spec_dep_clin_serv psdcs
          JOIN dep_clin_serv dcs
            ON dcs.id_dep_clin_serv = psdcs.id_dep_clin_serv
          JOIN department d
            ON d.id_department = dcs.id_department
        MINUS
        -- todas as instituicoes que ja contem um registo nesta tabela, com id_inst_orig=id_inst_dest (consultas)
        SELECT DISTINCT id_inst_dest
          FROM p1_dest_institution
         WHERE id_inst_orig = id_inst_dest
           AND flg_type = 'C';

    l_cur_tab table_number;

    l_limit PLS_INTEGER := 2000;
BEGIN

    OPEN c_cur;
    LOOP
    
        FETCH c_cur BULK COLLECT
            INTO l_cur_tab LIMIT l_limit;
    
        FORALL i IN 1 .. l_cur_tab.count
            INSERT INTO p1_dest_institution
                (id_dest_institution, id_inst_orig, id_inst_dest, flg_default, flg_type)
            VALUES
                (seq_p1_dest_institution.nextval,
                 l_cur_tab(i),
                 l_cur_tab(i),
                 pk_ref_constant.g_no,
                 pk_ref_constant.g_p1_type_c);
    
        FOR i IN 1 .. l_cur_tab.count
        LOOP
            NULL;
        END LOOP;
    
        COMMIT;
    
        EXIT WHEN l_cur_tab.count < l_limit;
    
    END LOOP;
    CLOSE c_cur;
END;
/
-- CHANGE END: Ana Monteiro

