-- CHANGE REASON: [ALERT-247719] 
DECLARE
    l_data_type VARCHAR2(100 CHAR);
    CURSOR c_cur IS
        SELECT data_type
          FROM user_tab_columns c
         WHERE c.table_name = 'REF_TRANS_RESP_HIST'
           AND c.column_name = 'ID_PROF_DEST';
BEGIN

    OPEN c_cur;
    FETCH c_cur
        INTO l_data_type;
    CLOSE c_cur;

    IF l_data_type != 'NUMBER'
    THEN
        INSERT INTO tbl_temp
            (num_1, num_2)
            SELECT id_trans_resp_hist, id_prof_dest
              FROM ref_trans_resp_hist;
    
        UPDATE ref_trans_resp_hist
           SET id_prof_dest = NULL;
    END IF;
END;
/
-- CHANGE END: Ana Monteiro

-- CHANGED BY: Ana Monteiro
-- CHANGE DATE: 19/12/2012 10:27
-- CHANGE REASON: [ALERT-247719] 
DECLARE
    l_id_prof_dest_tab       table_number;
    l_id_trans_resp_hist_tab table_number;
    l_limit                  PLS_INTEGER := 10000;

    CURSOR c_cur IS
        SELECT num_1, num_2
          FROM tbl_temp;
BEGIN
    OPEN c_cur;
    LOOP
    
        FETCH c_cur BULK COLLECT
            INTO l_id_trans_resp_hist_tab, l_id_prof_dest_tab LIMIT l_limit;
    
        FORALL i IN 1 .. l_id_trans_resp_hist_tab.count
            UPDATE ref_trans_resp_hist
               SET id_prof_dest = l_id_prof_dest_tab(i)
             WHERE id_trans_resp_hist = l_id_trans_resp_hist_tab(i);
    
        COMMIT;
    
        EXIT WHEN l_id_trans_resp_hist_tab.count < l_limit;
    END LOOP;
    CLOSE c_cur;
END;
/
-- CHANGE END: Ana Monteiro


