-- CHANGED BY:  Rui Gomes
-- CHANGE DATE: 21/05/2013 16:58
-- CHANGE REASON: [ALERT-248672] New frmw objs
DECLARE

    CURSOR c_dup_way IS
        SELECT major_id.id_way to_remove, minor_id.id_way to_keep
          FROM (SELECT *
                  FROM way xw
                 WHERE xw.flg_available = 'Y') minor_id,
               (SELECT *
                  FROM way xy
                 WHERE xy.flg_available = 'Y') major_id
         WHERE major_id.id_content = minor_id.id_content
           AND major_id.id_way > minor_id.id_way;

    CURSOR c_dup_chars IS
        SELECT major_id.id_hidrics_charact to_remove, minor_id.id_hidrics_charact to_keep
          FROM (SELECT *
                  FROM hidrics_charact xw
                 WHERE xw.flg_available = 'Y') minor_id,
               (SELECT *
                  FROM hidrics_charact xy
                 WHERE xy.flg_available = 'Y') major_id
         WHERE major_id.id_content = minor_id.id_content
           AND major_id.id_hidrics_charact > minor_id.id_hidrics_charact;
BEGIN
    FOR cw IN c_dup_way
    LOOP
        UPDATE way w
           SET w.flg_available = 'N'
         WHERE w.id_way = cw.to_remove;
    END LOOP;
    FOR ch IN c_dup_chars
    LOOP
        UPDATE hidrics_charact w
           SET w.flg_available = 'N'
         WHERE w.id_hidrics_charact = ch.to_remove;
    END LOOP;
END;
/
-- CHANGE END:  Rui Gomes


