                         when EXISTS(SELECT 1 FROM sample_text WHERE id_sample_text = s.id_reason) then 'R'
                         else 'RP'
                       end
WHERE id_reason IS NOT NULL 
   AND flg_reason_type IS NULL;
   
UPDATE schedule s 
