     id_reason = id_complaint
WHERE id_complaint IS NOT NULL
   AND flg_reason_type IS NULL;
   
UPDATE schedule_hist s 
SET flg_reason_type = 'C',
     id_reason = id_complaint
WHERE id_complaint IS NOT NULL
   AND flg_reason_type IS NULL;
   
