-- CHANGE DATE: 10/09/2014 16:28
-- CHANGE REASON: [ALERT-294272] Pregnancy button - Create a current pregnancy record - Document information and save - An error occurs
DECLARE
    l_cont_type      NUMBER;
    l_cont_type_hist NUMBER;
    
    PROCEDURE run_ddl(i_sql IN VARCHAR2) IS
    BEGIN
        EXECUTE IMMEDIATE i_sql;
    EXCEPTION
        WHEN OTHERS THEN
            dbms_output.put_line('WARNING - ' || REPLACE(srcstr => SQLERRM, oldsub => 'ORA-', newsub => '') || '; ' ||
                                 i_sql || ';');
    END run_ddl;

BEGIN
    
    
    run_ddl(i_sql => 'ALTER TABLE pat_preg_cont_type add CONSTRAINT m_opt_id_contrac_type_fk foreign key(id_contrac_type) references multichoice_option(id_multichoice_option)');
    
    run_ddl(i_sql => 'ALTER TABLE pat_preg_cont_type add CONSTRAINT pat_preg_cont_type_pk primary key(id_pat_pregnancy, id_contrac_type)
    USING INDEX tablespace table_s pctfree 10 initrans 2 maxtrans 255 storage(initial 128k NEXT 128k minextents 1
                                                                              maxextents unlimited pctincrease 0)');
                                                                              
                                                                              
    run_ddl(i_sql => 'ALTER TABLE pat_preg_cont_type_hist add CONSTRAINT m_opt_id_contrac_type_hist_fk foreign key(id_contrac_type) references multichoice_option(id_multichoice_option)');

    run_ddl(i_sql => 'ALTER TABLE pat_preg_cont_type_hist add CONSTRAINT pat_preg_cont_type_hist_pk primary key(id_pat_pregnancy_hist,
                                                                                          id_contrac_type)
    USING INDEX tablespace table_s pctfree 10 initrans 2 maxtrans 255 storage(initial 128k NEXT 128k minextents 1
                                                                              maxextents unlimited pctincrease 0)'); 

    BEGIN
        SELECT COUNT(0)
          INTO l_cont_type
          FROM pat_preg_cont_type ppct
         WHERE ppct.id_contrac_type IS NULL;
    EXCEPTION
        WHEN no_data_found THEN
            l_cont_type := 0;
        WHEN OTHERS THEN
            dbms_output.put_line('WARNING - ' || REPLACE(srcstr => SQLERRM, oldsub => 'ORA-', newsub => '') || '; ');
    END;

    BEGIN
        SELECT COUNT(0)
          INTO l_cont_type_hist
          FROM pat_preg_cont_type_hist ppcth
         WHERE ppcth.id_contrac_type IS NULL;
    EXCEPTION
        WHEN no_data_found THEN
            l_cont_type_hist := 0;
        WHEN OTHERS THEN
            dbms_output.put_line('WARNING - ' || REPLACE(srcstr => SQLERRM, oldsub => 'ORA-', newsub => '') || '; ');
    END;
    IF (l_cont_type <> 0 OR l_cont_type_hist <> 0)
    THEN
        raise_application_error(-20101, 'COLUMN MIGRATION FAILED, PLEASE REPORT THIS ERROR TO DEVELOPMENT TEAM.');
    ELSE
    
        BEGIN
            EXECUTE IMMEDIATE 'ALTER TABLE PAT_PREG_CONT_TYPE DROP COLUMN FLG_CONTRAC_TYPE';
        EXCEPTION
            WHEN OTHERS THEN
                dbms_output.put_line('WARNING - PAT_PREG_CONT_TYPE FLG_CONTRAC_TYPE Column already dropped');
        END;
    
        BEGIN
            EXECUTE IMMEDIATE 'ALTER TABLE PAT_PREG_CONT_TYPE_HIST DROP COLUMN FLG_CONTRAC_TYPE';
        EXCEPTION
            WHEN OTHERS THEN
                dbms_output.put_line('WARNING - PAT_PREG_CONT_TYPE_HIST  FLG_CONTRAC_TYPE Column already dropped');
        END;
    
    END IF;
END;
/
-- CHANGE END:  Gisela Couto

