-- CHANGE REASON: [ALERT-296110] Dev DB - Remove references to old alerts columns - alter tables
DECLARE
    e_already_dropped EXCEPTION;
    e_already_changed EXCEPTION;
    PRAGMA EXCEPTION_INIT(e_already_dropped, -00904);
    PRAGMA EXCEPTION_INIT(e_already_changed, -01442);
BEGIN

    BEGIN
        EXECUTE IMMEDIATE 'alter table sys_alert modify VERSION default ''E'' not null';
    EXCEPTION
        WHEN e_already_changed THEN
            dbms_output.put_line('Warning - column sys_alert.VERSION was already modified');
WHEN e_already_dropped THEN
            dbms_output.put_line('Warning - column sys_alert.VERSION doesnt exists');
    END;

    BEGIN
        EXECUTE IMMEDIATE 'alter table sys_alert modify sql_alert not null';
    EXCEPTION
        WHEN e_already_changed THEN
            dbms_output.put_line('Warning - column sys_alert.sql_alert was already modified');
WHEN e_already_dropped THEN
            dbms_output.put_line('Warning - column sys_alert.sql_alert doesnt exists');
    END;

    BEGIN
        EXECUTE IMMEDIATE 'alter table sys_alert drop column alert_sql';
    EXCEPTION
        WHEN e_already_dropped THEN
            dbms_output.put_line('Warning - column sys_alert.sql_alert already dropped');
    END;

    BEGIN
        EXECUTE IMMEDIATE 'alter table sys_alert drop column VERSION';
    EXCEPTION
        WHEN e_already_dropped THEN
            dbms_output.put_line('Warning - column sys_alert.sql_alert already dropped');
    END;

END;
/
-- CHANGE END:  Gisela Couto

