-- CHANGED BY: mario.mineiro
-- CHANGE DATE: 14/11/2014 10:28
-- CHANGE REASON: [ALERT-302189] 
DECLARE
    CURSOR c_rep IS
        SELECT id_vacc, id_patient, flg_status, COUNT(*)
          FROM pat_vacc_adm pva
         WHERE flg_status = 'S'
           AND pva.id_pat_vacc_adm NOT IN (SELECT pva1.id_parent
                                             FROM alert.pat_vacc_adm pva1
                                            WHERE pva1.id_patient = pva.id_patient
                                              AND pva1.id_vacc = pva.id_vacc
                                              AND pva1.flg_status = 'R')
         GROUP BY id_vacc, id_patient, flg_status
        HAVING COUNT(*) > 1;

BEGIN

    FOR i IN c_rep
    LOOP
        -- get the max
    
        FOR x IN (SELECT id_pat_vacc_adm id
                    FROM pat_vacc_adm pva
                   WHERE id_vacc = i.id_vacc
                     AND id_patient = i.id_patient
                     AND flg_status = 'S'
                     AND pva.id_pat_vacc_adm NOT IN (SELECT pva1.id_parent
                                                       FROM alert.pat_vacc_adm pva1
                                                      WHERE pva1.id_patient = pva.id_patient
                                                        AND pva1.id_vacc = pva.id_vacc
                                                        AND pva1.flg_status = 'R')
                     AND id_pat_vacc_adm NOT IN
                         (SELECT MIN(id_pat_vacc_adm)
                            FROM pat_vacc_adm pva
                           WHERE id_vacc = i.id_vacc
                             AND id_patient = i.id_patient
                             AND flg_status = 'S'
                             AND pva.id_pat_vacc_adm NOT IN (SELECT pva1.id_parent
                                                               FROM alert.pat_vacc_adm pva1
                                                              WHERE pva1.id_patient = pva.id_patient
                                                                AND pva1.id_vacc = pva.id_vacc
                                                                AND pva1.flg_status = 'R')))
        LOOP
            -- do the delete
        
            DELETE pat_vacc_adm_det
             WHERE id_pat_vacc_adm = x.id;
            DELETE pat_vacc_adm
             WHERE id_pat_vacc_adm = x.id;
        END LOOP;
    END LOOP;

END;
/
-- CHANGE END: mario.mineiro

-- CHANGED BY: teresa.coutinho
-- CHANGE DATE: 27/11/2014 16:54
-- CHANGE REASON: [ALERT-303175] 
DECLARE
    l_id_language language.id_language%TYPE;
    l_profiles    table_number := table_number(956, 957, 958, 959, 960);
    l_prof        alert.profissional;

    l_id_profile_template profile_template.id_profile_template%TYPE;
    l_error               t_error_out;
BEGIN
    FOR rec IN (SELECT *
                  FROM prof_profile_template ppt
                  JOIN TABLE(l_profiles) p
                    ON p.column_value = ppt.id_profile_template
                   AND EXISTS (SELECT pi.id_prof_institution
                          FROM prof_institution pi
                         WHERE pi.id_professional = ppt.id_professional
                           AND pi.id_institution = ppt.id_institution
                           AND pi.dt_end_tstz IS NULL))
    LOOP
    
        BEGIN
            SELECT il.id_language
              INTO l_id_language
              FROM institution_language il
             WHERE il.flg_available = 'Y'
               AND il.id_institution = rec.id_institution
               AND rownum = 1;
        EXCEPTION
            WHEN no_data_found THEN
                l_id_language := 2;
        END;
    
        l_prof := alert.profissional(rec.id_professional, rec.id_institution, rec.id_software);
    
        IF NOT pk_access.set_prof_alerts(i_lang                => l_id_language,
                                         i_id_prof             => l_prof,
                                         i_id_profile_template => rec.id_profile_template,
                                         o_error               => l_error)
        THEN
            dbms_output.put_line(l_error.ora_sqlerrm || ' lcall: ' || l_error.log_id || ' l_id_profile_template: ' ||
                                 rec.id_profile_template || ' id_professional: ' || rec.id_professional ||
                                 ' id_institution: ' || rec.id_institution || ' id_software: ' || rec.id_software);
        END IF;
    
        COMMIT;
    END LOOP;
END;
/
-- CHANGE END: teresa.coutinho


