DECLARE
    already_exists EXCEPTION;
    PRAGMA EXCEPTION_INIT(already_exists, -00955);
BEGIN
    EXECUTE IMMEDIATE '
    create unique index bab_uk1 on bmng_allocation_bed (
            CASE  WHEN (flg_outdated = ''N'') THEN flg_outdated END,
            CASE  WHEN (flg_outdated = ''N'') THEN id_episode END)';
EXCEPTION
    WHEN already_exists THEN
        dbms_output.put_line('Already exists.');
    WHEN OTHERS THEN
        dbms_output.put_line('Already exists.');
END;
/
-- CHANGE END: Vanessa Barsottelli

-- CHANGED BY: Vanessa Barsottelli
-- CHANGE DATE: 13/05/2016 11:48
-- CHANGE REASON: [ALERT-321224] Register inpatient episode: error (episode rescheduled)

UPDATE bmng_allocation_bed bab
   SET bab.flg_outdated = 'Y'
 WHERE bab.id_bmng_allocation_bed IN (SELECT aux.id_bmng_allocation_bed
                                        FROM (SELECT a.id_bmng_allocation_bed,
                                                     row_number() over(PARTITION BY a.id_episode ORDER BY a.dt_creation DESC, a.create_time DESC) rn
                                                FROM bmng_allocation_bed a
                                               WHERE a.flg_outdated = 'N') aux
                                       WHERE aux.rn <> 1);


DECLARE
    already_exists EXCEPTION;
