-- CHANGED BY: Ana Matos
-- CHANGE DATE: 05/12/2016 17:28
-- CHANGE REASON: [ALERT-326930] 
DECLARE
    CURSOR c_analysis IS
        SELECT id_analysis_room
          FROM (SELECT ar.id_analysis_room,
                       row_number() over(PARTITION BY ar.id_analysis, ar.id_sample_type, ar.flg_type, ar.id_institution, ar.id_analysis_instit_soft, ar.flg_default ORDER BY ar.id_analysis_room) rn
                  FROM analysis_room ar
                 WHERE ar.flg_default = 'Y') ar
         WHERE rn > 1;

    l_analysis_room           table_number := table_number();
BEGIN

    OPEN c_analysis;

    LOOP
        FETCH c_analysis BULK COLLECT
            INTO l_analysis_room LIMIT 100;
    
        FORALL i IN 1 .. l_analysis_room.count
            UPDATE analysis_room
               SET flg_default = 'X'
             WHERE id_analysis_room = l_analysis_room(i);
    
        EXIT WHEN c_analysis%NOTFOUND;
    END LOOP;

    CLOSE c_analysis;

    DELETE analysis_room
     WHERE id_analysis_room IN (SELECT id_analysis_room
                                  FROM (SELECT ar.id_analysis_room,
                                               row_number() over(PARTITION BY ar.id_analysis, ar.id_sample_type, ar.flg_type, ar.id_institution, ar.id_analysis_instit_soft, ar.id_room ORDER BY ar.flg_available DESC, ar.id_analysis_room) rn
                                          FROM analysis_room ar
                                         WHERE ar.flg_default IN ('N', 'X')) ar
                                 WHERE rn > 1);

    UPDATE analysis_room
       SET flg_default = 'N'
     WHERE flg_default = 'X';

END;
/
