-- CHANGE DATE: 14/07/2017 14:08
-- CHANGE REASON: [ALERT-331061]
DECLARE

    CURSOR sr_interv IS
        SELECT a.id_sr_intervention,
               a.code_sr_intervention,
               a.flg_status, --
               a.flg_type, --
               a.duration, -- 
               a.prev_recovery_time, --
               a.gdh, -- vai cair
               a.icd, --
               a.gender, --
               a.age_min, --
               a.age_max, --
               a.cost, --
               a.price, --
               a.id_system_organ, --
               a.id_speciality, -- vai cair
               a.flg_coding,
               a.id_content
          FROM sr_intervention 
         INNER JOIN translation b
            ON a.code_sr_intervention = b.code_translation
         WHERE a.id_content IS NOT NULL
           AND (a.flg_status = 'A' OR (a.flg_status = 'I' AND EXISTS
                (SELECT 1
                                          FROM sr_epis_interv sr
                                         WHERE sr.id_sr_intervention = a.id_sr_intervention)));

    CURSOR sr_interv_dep(id sr_intervention.id_sr_intervention%TYPE) IS
        SELECT DISTINCT a.id_dep_clin_serv, a.flg_type, a.id_institution, a.id_software, a.rank
          FROM sr_interv_dep_clin_serv a
         WHERE id_sr_intervention = id;

    l_interv_ind      NUMBER(24);
    l_interv_cod_ind  NUMBER(24);
    l_interv_dep      NUMBER(24);
    l_transl          VARCHAR2(100 CHAR);
    l_id_codification NUMBER(6);

    row_sr sr_interv%ROWTYPE;

    row_sr_dep sr_interv_dep%ROWTYPE;

    l_exception EXCEPTION;

    l_count       NUMBER;
    l_count_trans NUMBER;

BEGIN

    --OPEN sr_interv;

    FOR row_sr IN sr_interv
    LOOP
        BEGIN
        
            SELECT COUNT(*)
              INTO l_count
              FROM intervention i
             WHERE i.id_content = row_sr.id_content;
        
            IF l_count = 0
            THEN
            
                l_interv_ind := seq_intervention.nextval;
                l_transl     := 'INTERVENTION.CODE_INTERVENTION.' || l_interv_ind;
            
                INSERT INTO intervention
                    (id_intervention,
                     code_intervention,
                     flg_status,
                     cost,
                     price,
                     rank,
                     flg_mov_pat,
                     flg_type,
                     duration,
                     gender,
                     age_min,
                     age_max,
                     id_content,
                     flg_category_type,
                     prev_recovery_time,
                     id_system_organ)
                VALUES
                    (l_interv_ind,
                     l_transl,
                     row_sr.flg_status,
                     row_sr.cost,
                     row_sr.price,
                     100,
                     'N',
                     row_sr.flg_type,
                     row_sr.duration,
                     row_sr.gender,
                     row_sr.age_min,
                     row_sr.age_max,
                     row_sr.id_content,
                     'SR',
                     row_sr.prev_recovery_time,
                     row_sr.id_system_organ);
            
                UPDATE sr_epis_interv
                   SET id_sr_intervention = l_interv_ind
                 WHERE id_sr_intervention = row_sr.id_sr_intervention;
            
                UPDATE sr_epis_interv_hist
                   SET id_sr_intervention = l_interv_ind
                 WHERE id_sr_intervention = row_sr.id_sr_intervention;
            
                UPDATE sr_surgery_record
                   SET id_sr_intervention = l_interv_ind
                 WHERE id_sr_intervention = row_sr.id_sr_intervention;
            
                UPDATE sr_interv_duration
                   SET id_sr_intervention = l_interv_ind
                 WHERE id_sr_intervention = row_sr.id_sr_intervention;
            
                l_interv_cod_ind := seq_interv_codification.nextval;
            
                BEGIN
                    SELECT id_codification
                      INTO l_id_codification
                      FROM sr_interv_codification
                     WHERE flg_coding = row_sr.flg_coding;
                
                    INSERT INTO interv_codification
                        (id_interv_codification, id_codification, id_intervention, flg_available, standard_code)
                    VALUES
                        (l_interv_cod_ind,
                         l_id_codification,
                         l_interv_ind,
                         decode(row_sr.flg_status, 'A', 'Y', 'N'),
                         row_sr.icd);
                EXCEPTION
                    WHEN OTHERS THEN
                        NULL;
                END;
            
                FOR row_sr_dep IN sr_interv_dep(row_sr.id_sr_intervention)
                LOOP
                
                    l_interv_dep := seq_interv_dep_clin_serv.nextval;
                
                    INSERT INTO interv_dep_clin_serv
                        (id_interv_dep_clin_serv,
                         id_intervention,
                         id_dep_clin_serv,
                         flg_type,
                         rank,
                         id_institution,
                         id_software)
                    VALUES
                        (l_interv_dep,
                         l_interv_ind,
                         row_sr_dep.id_dep_clin_serv,
                         row_sr_dep.flg_type,
                         row_sr_dep.rank,
                         row_sr_dep.id_institution,
                         row_sr_dep.id_software);
                
                END LOOP;
            
            ELSE
            
                SELECT COUNT(*)
                  INTO l_count_trans
                  FROM sr_epis_interv a
                 INNER JOIN sr_intervention b
                    ON a.id_sr_intervention = b.id_sr_intervention
                 WHERE b.id_content = row_sr.id_content;
            
                IF l_count_trans > 0
                THEN
                
                    l_interv_ind := seq_intervention.nextval;
                    l_transl     := 'INTERVENTION.CODE_INTERVENTION.' || l_interv_ind;
                
                    INSERT INTO intervention
                        (id_intervention,
                         code_intervention,
                         flg_status,
                         cost,
                         price,
                         rank,
                         flg_mov_pat,
                         flg_type,
                         duration,
                         gender,
                         age_min,
                         age_max,
                         id_content,
                         flg_category_type,
                         prev_recovery_time,
                         id_system_organ)
                    VALUES
                        (l_interv_ind,
                         l_transl,
                         'I',
                         row_sr.cost,
                         row_sr.price,
                         100,
                         'N',
                         row_sr.flg_type,
                         row_sr.duration,
                         row_sr.gender,
                         row_sr.age_min,
                         row_sr.age_max,
                         row_sr.id_content || '_MIG',
                         'SR',
                         row_sr.prev_recovery_time,
                         row_sr.id_system_organ);
                
                    l_interv_cod_ind := seq_interv_codification.nextval;
                
                    BEGIN
                        SELECT id_codification
                          INTO l_id_codification
                          FROM sr_interv_codification
                         WHERE flg_coding = row_sr.flg_coding;
                    
                        INSERT INTO interv_codification
                            (id_interv_codification, id_codification, id_intervention, flg_available, standard_code)
                        VALUES
                            (l_interv_cod_ind,
                             l_id_codification,
                             l_interv_ind,
                             decode(row_sr.flg_status, 'A', 'Y', 'N'),
                             row_sr.icd);
                    EXCEPTION
                        WHEN OTHERS THEN
                            NULL;
                    END;
                
                    FOR row_sr_dep IN sr_interv_dep(row_sr.id_sr_intervention)
                    LOOP
                    
                        l_interv_dep := seq_interv_dep_clin_serv.nextval;
                    
                        INSERT INTO interv_dep_clin_serv
                            (id_interv_dep_clin_serv,
                             id_intervention,
                             id_dep_clin_serv,
                             flg_type,
                             rank,
                             id_institution,
                             id_software)
                        VALUES
                            (l_interv_dep,
                             l_interv_ind,
                             row_sr_dep.id_dep_clin_serv,
                             row_sr_dep.flg_type,
                             row_sr_dep.rank,
                             row_sr_dep.id_institution,
                             row_sr_dep.id_software);
                    
                    END LOOP;
                
                END IF;
            
            END IF;
        
        EXCEPTION
            WHEN OTHERS THEN 
                dbms_output.put_line(row_sr.id_sr_intervention);
                dbms_output.put_line(SQLERRM);
                RAISE l_exception;
            
        END;
    
    END LOOP;

END;
