--- Build items
declare

    -- CONSTANT
    k_slg        constant varchar2(0500 char) := 'DEATH_REGISTRY_INTV_DISEA_MUERTE';
    k_comp_name constant varchar2(0500 char) := 'DEATH_TIPO_DT_DEFUNCION';
    k_comp_code constant varchar2(0500 char) := 'DS_COMPONENT.CODE_DS_COMPONENT.';
    k_mkt_mx    constant number := 16;
    k_lang_mx constant number := 17;

    -- Work variables
    tbl_comp        table_number := table_number(450, 451, 452, 453, 454, 455);
    tbl_old_comp     table_number := table_number(328, 329, 330, 332, 334, 431);
    tbl_comp_mkt    table_number := table_number(745, 780, 781, 782, 783, 784);
    --tbl_def_event table_number := table_number(600, 601, 602, 603, 604, 605);
    

    -- INLINE
    
    function get_internal_name( i_id_comp in number ) RETURN varchar2 is
        tbl_name    table_varchar;
        l_return    varchar2(4000);
    begin
    
        SELECT internal_name 
        bulk collect into tbl_name
        FROM ds_component d 
        WHERE d.id_ds_component = i_id_comp;
        
        if tbl_name.count > 0 then
            l_return := tbl_name(1);
        end if;
    
        return l_return;
    
    end get_internal_name;
    
    
    -- *****************************************************************
    procedure ins_comp( i_idx in number ) is
        l_comp_name   varchar2(0200 char);
        l_id        number;
        l_code      varchar2(0200 char);

    begin

        l_id        := tbl_comp( i_idx );
        l_comp_name := k_comp_name||to_char(i_idx);
        l_code      := k_comp_code||to_char(l_id);
    
        insert into ds_component 
        (ID_DS_COMPONENT, INTERNAL_NAME, FLG_COMPONENT_TYPE, CODE_DS_COMPONENT, FLG_DATA_TYPE, SLG_INTERNAL_NAME)
        values 
        (l_id, l_comp_name, 'L', l_code, 'MS', k_slg);
    
    end ins_comp;
    
    -- *****************************************************************
    procedure ins_trl(i_idx in number ) is
        l_code          varchar2(0200 char);
        l_old_code      varchar2(0200 char);
        k_full_desc     varchar2(4000 ):= 'Intervalo aproximado entre el inicio de la enfermedad y la muerte';
        k_empty_desc    varchar2(4000 ):= chr(32);
    begin
    
        l_code      := k_comp_code|| tbl_comp( i_idx );
        l_old_code  := k_comp_code|| tbl_old_comp( i_idx );
    
        pk_translation.insert_into_translation( k_lang_mx, l_code, k_full_desc);
        pk_translation.clean_translation( k_lang_mx, l_old_code);
        pk_translation.insert_into_translation( k_lang_mx, l_old_code, k_empty_desc);
    
    END ins_trl;
    
begin

    -- INI
    <<LUP_THRU_COMPONENTS>>
    FOR I in 1..tbl_comp.count loop

