    procedure ins_sys_list_group IS
        L_SQL VARCHAR2(4000);
        l_num   number;
        l_name    varchar2(4000); 
        l_desc    VARCHAR2(4000);
    BEGIN

        for i in 1..tbl_sys_l_group.count loop

            l_num   := tbl_sys_l_group(i);
            l_name    := tbl_sys_l_name(i); 
            l_desc    := tbl_sys_l_desc(i);

            L_SQL := Q'[INSERT INTO SYS_LIST_GROUP (ID_SYS_LIST_GROUP, INTERNAL_NAME, INTERNAL_DESC) VALUES ]';
            l_sql := l_sql || q'[('#1#', '#2#', '#3#')]';
            
            l_sql := replace( l_sql, k_mask_1, l_num );
            l_sql := replace( l_sql, k_mask_2, l_name );
            l_sql := replace( l_sql, k_mask_3, l_desc );
            
            PK_VERSIONING.RUN_DML(I_SQL => L_SQL);
        
        end loop;
        
    END ins_sys_list_group;

begin
    ins_sys_list_group();
end;
