-- CHANGE REASON: [EMR-11718] Latemix
DECLARE
    l_grid_icon       wf_status.icon%TYPE;
    l_status_color    wf_status.color%TYPE;
    l_status_rank     wf_status.rank%TYPE:= 100;
    l_disp_ivroom_str VARCHAR2(200 CHAR);
    l_status_icon     wf_status.icon%TYPE;
BEGIN

    FOR l_rec IN (SELECT vd.id_episode
                    FROM grid_task gt
                   INNER JOIN v_pha_dispense vd
                      ON vd.id_episode = gt.id_episode
                   WHERE vd.flg_prepared_iv_room = 'Y'
                     AND vd.id_status IN (1790, 1791, 1792, 518)
                     AND gt.disp_ivroom IS NULL
                   GROUP BY vd.id_episode)
    LOOP
        l_status_icon:=''; 
        l_status_rank:= 100;
        l_status_color:='';  
        l_grid_icon:='';                
        FOR l_rec1 IN (SELECT vd.id_status, vd.flg_dispense_type
                         FROM v_pha_dispense vd
                        WHERE vd.id_episode = l_rec.id_episode
                          AND vd.flg_prepared_iv_room = 'Y'
                          AND vd.id_status IN (1790, 1791, 1792, 518))
        LOOP
            IF l_rec1.id_status = 1790
               AND l_rec1.flg_dispense_type = 'R'
               AND l_status_rank > 1
            THEN
                l_status_color := '0xE8BE44';
                l_status_rank  := 1;
                l_status_icon  := l_rec1.id_status;
            ELSIF l_rec1.id_status = 1790
                  AND l_status_rank > 2
            THEN
                l_status_color := '';
                l_status_rank  := 2;
                l_status_icon  := l_rec1.id_status;
            ELSIF l_rec1.id_status = 1791
                  AND l_status_rank > 3
                  AND l_rec1.flg_dispense_type = 'R'
            THEN
                l_status_color := '0xE8BE44';
                l_status_rank  := 3;
                l_status_icon  := l_rec1.id_status;
            ELSIF l_rec1.id_status = 1791
                  AND l_status_rank > 4
            THEN
                l_status_color := '';
                l_status_rank  := 4;
                l_status_icon  := l_rec1.id_status;
            ELSIF l_rec1.id_status = 1792
                  AND l_rec1.flg_dispense_type = 'R'
                  AND l_status_rank > 5
            THEN
                l_status_color := '0xE8BE44';
                l_status_rank  := 5;
                l_status_icon  := l_rec1.id_status;
            ELSIF l_rec1.id_status = 1792
                  AND l_status_rank > 6
            THEN
                l_status_color := '';
