            THEN
                l_status_color := '0xE8BE44';
                l_status_rank  := 7;
                l_status_icon  := l_rec1.id_status;
            ELSIF l_rec1.id_status = 518
                  AND l_status_rank > 8
            THEN
                l_status_color := '';
                l_status_rank  := 8;
                l_status_icon  := l_rec1.id_status;
            END IF;        
               
        END LOOP;
    
        SELECT ws.icon
          INTO l_grid_icon
          FROM wf_status ws
         WHERE ws.id_status = l_status_icon
           AND rownum = 1;
    
        l_disp_ivroom_str := '6|I|||' || l_grid_icon || '|' || l_status_color || '|||||' || l_status_rank;
    
        UPDATE grid_task gt
           SET gt.disp_ivroom = l_disp_ivroom_str
         WHERE gt.id_episode = l_rec.id_episode;
    END LOOP;

END;
