DECLARE
    l_grid_icon     wf_status.icon%TYPE;
    l_status_color  wf_status.color%TYPE;
    l_status_rank   wf_status.rank%TYPE := 100;
    l_disp_task_str VARCHAR2(200 CHAR);
    l_status_icon   wf_status.icon%TYPE;
BEGIN

    FOR l_rec IN (SELECT vd.id_episode
                    FROM grid_task gt
                   INNER JOIN v_pha_dispense vd
                      ON vd.id_episode = gt.id_episode                  
                   GROUP BY vd.id_episode)
    LOOP
        l_status_icon  := '';
        l_status_rank  := 100;
        l_status_color := '';
        l_grid_icon    := '';
        FOR l_rec1 IN (SELECT vd.id_status, vd.flg_dispense_type
                         FROM v_pha_dispense vd
                        WHERE vd.id_episode = l_rec.id_episode
                          )
        LOOP
            IF l_rec1.id_status = 529
               AND l_rec1.flg_dispense_type = 'R'
               AND l_status_rank > 4
            THEN
                l_status_rank := 4;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 517
                  AND l_rec1.flg_dispense_type = 'R'
                  AND l_status_rank > 5
            THEN
                l_status_rank := 5;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 522
                  AND l_rec1.flg_dispense_type = 'R'
                  AND l_status_rank > 6
            THEN
                l_status_rank := 6;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 520
                  AND l_rec1.flg_dispense_type = 'R'
                  AND l_status_rank > 7
            THEN
                l_status_rank := 7;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 531
                  AND l_rec1.flg_dispense_type = 'R'
                  AND l_status_rank > 7.5
            THEN
                l_status_rank := 7.5;
                l_status_icon := l_rec1.id_status;
                ----------------                
            ELSIF l_rec1.id_status = 517
                  AND l_status_rank > 8
            THEN
                l_status_rank := 8;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 522
                  AND l_status_rank > 9
            THEN
                l_status_rank := 9;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 520
                  AND l_status_rank > 10
            THEN
                l_status_rank := 10;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 531
                  AND l_status_rank > 10.5
            THEN
                l_status_rank := 10.5;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 523
                  AND l_rec1.flg_dispense_type IN ('R', 'T')
                  AND l_status_rank > 11
            THEN
                l_status_rank := 11;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 524
                  AND l_rec1.flg_dispense_type IN ('R', 'T')
                  AND l_status_rank > 12
            THEN
                l_status_rank := 12;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 525
                  AND l_rec1.flg_dispense_type IN ('R', 'T')
                  AND l_status_rank > 13
            THEN
                l_status_rank := 13;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 518
                  AND l_rec1.flg_dispense_type = 'R'
                  AND l_status_rank > 14
            THEN
                l_status_rank := 14;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status IN (518, 528)
                  AND l_status_rank > 15
            THEN
                l_status_rank := 15;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 521
                  AND l_rec1.flg_dispense_type = 'R'
                  AND l_status_rank > 16
            THEN
                l_status_rank := 16;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 521
                  AND l_status_rank > 17
            THEN
                l_status_rank := 17;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 519
                  AND l_rec1.flg_dispense_type = 'R'
                  AND l_status_rank > 19
            THEN
                l_status_rank := 19;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 519
                  AND l_status_rank > 20
            THEN
                l_status_rank := 20;
                l_status_icon := l_rec1.id_status;
                ----------------
            END IF;
        
        END LOOP;
    
        IF l_status_rank IN (4, 5, 6, 7, 7.5, 11, 12, 14, 16, 19)
        THEN
            l_status_color := '0xE8BE44';
        END IF;
    
        BEGIN
            SELECT ws.icon
              INTO l_grid_icon
              FROM wf_status ws
             WHERE ws.id_status = l_status_icon
               AND rownum = 1;
        EXCEPTION
            WHEN no_data_found THEN
                l_grid_icon := NULL;
        END;
        l_disp_task_str := '6|I|||' || l_grid_icon || '|' || l_status_color || '|||||' || l_status_rank;
    
        UPDATE grid_task gt
           SET gt.disp_task = l_disp_task_str
         WHERE gt.id_episode = l_rec.id_episode;
    END LOOP;

END;
