    FOR l_rec IN (SELECT vd.id_episode
                    FROM grid_task gt
                   INNER JOIN v_pha_dispense vd
                      ON vd.id_episode = gt.id_episode
                   GROUP BY vd.id_episode)
    LOOP
        l_status_icon  := '';
        l_status_rank  := 100;
        l_status_color := '';
        l_grid_icon    := '';
        FOR l_rec1 IN (SELECT vr.id_status
                         FROM v_pha_dispense vd
                        INNER JOIN v_pha_review vr
                           ON vr.id_task = vd.id_task
                        WHERE vd.id_episode = l_rec.id_episode)
        LOOP
            IF l_rec1.id_status = 402
               AND l_status_rank > 1
            THEN
                l_status_rank := 1;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 401
                  AND l_status_rank > 2
            THEN
                l_status_rank := 2;
                l_status_icon := l_rec1.id_status;
            
            ELSIF l_rec1.id_status = 400
                  AND l_status_rank > 3
            THEN
                l_status_rank := 3;
                l_status_icon := l_rec1.id_status;
            END IF;
            IF l_rec1.id_status = 403
               AND l_status_rank > 13
            THEN
                l_status_rank := 13;
                l_status_icon := l_rec1.id_status;
                ----------------
            ELSIF l_rec1.id_status = 404
                  AND l_status_rank > 18
            THEN
                l_status_rank := 18;
                l_status_icon := l_rec1.id_status;
            END IF;
        
        END LOOP;
    
        BEGIN
            SELECT ws.icon
              INTO l_grid_icon
              FROM wf_status ws
             WHERE ws.id_status = l_status_icon
               AND rownum = 1;
        EXCEPTION
            WHEN no_data_found THEN
                l_grid_icon := NULL;
        END;
        l_drug_req_str := '6|I|||' || l_grid_icon || '|' || l_status_color || '|||||' || l_status_rank;
    
        UPDATE grid_task gt
           SET gt.drug_req = l_drug_req_str
         WHERE gt.id_episode = l_rec.id_episode;
    END LOOP;

END;
