-- CHANGE REASON: [EMR-17291] PEM
--Retiar a ação 'Envia prescrição electronicamente' por defeito (mas pode ser ativada localmente)
BEGIN
DELETE wf_transition_config wtc
 WHERE (wtc.id_workflow, wtc.id_status_begin, wtc.id_status_end, wtc.id_workflow_action, wtc.id_software,
        wtc.id_institution, wtc.id_category, wtc.id_profile_template, wtc.id_functionality) IN
       (SELECT wtc.id_workflow,
               wtc.id_status_begin,
               wtc.id_status_end,
               wtc.id_workflow_action,
               wtc.id_software,
               wtc.id_institution,
               wtc.id_category,
               wtc.id_profile_template,
               wtc.id_functionality
          FROM alert.wf_transition_config wtc
          JOIN alert.wf_status ws
            ON ws.id_status = wtc.id_status_begin
          JOIN alert.wf_status wse
            ON wse.id_status = wtc.id_status_end
          JOIN wf_action wf
            ON wf.id_workflow_action = wtc.id_workflow_action
          JOIN action a
            ON a.id_action = wf.id_action
         WHERE wf.id_action = 701507);
END;
/
