DECLARE
    l_sql VARCHAR2(1000 CHAR);
BEGIN

    DELETE FROM vital_sign_pregnancy v
     WHERE v.id_vital_sign_pregnancy IN
           (SELECT id_vital_sign_pregnancy
              FROM (SELECT v.id_vital_sign_pregnancy,
                           v.id_pat_pregnancy,
                           v.id_vital_sign_read,
                           v.fetus_number,
                           row_number() over(PARTITION BY v.id_pat_pregnancy, v.id_vital_sign_read, v.fetus_number ORDER BY v.id_vital_sign_pregnancy DESC) AS rn
                      FROM vital_sign_pregnancy v
                      JOIN (SELECT vsp.id_pat_pregnancy, vsp.id_vital_sign_read, vsp.fetus_number
                             FROM vital_sign_pregnancy vsp
                            GROUP BY vsp.id_pat_pregnancy, vsp.id_vital_sign_read, vsp.fetus_number
                           HAVING COUNT(1) > 1) t
                        ON t.id_pat_pregnancy = v.id_pat_pregnancy
                       AND t.id_vital_sign_read = v.id_vital_sign_read
                       AND t.fetus_number = v.fetus_number)
             WHERE rn > 1);

    l_sql := 'ALTER TABLE vital_sign_pregnancy ADD CONSTRAINT vsp_fk_uni UNIQUE(id_pat_pregnancy, id_vital_sign_read, fetus_number)';
    pk_versioning.run(l_sql);

END;
/
