DECLARE
    row_sp   sr_posit%ROWTYPE;
    row_spis sr_posit_instit_soft%ROWTYPE;

    l_id_positioning   positioning.id_positioning%TYPE;
    l_desc_positioning positioning.code_positioning%TYPE;
BEGIN

    EXECUTE IMMEDIATE ('ALTER TABLE SR_POSIT_REL DROP CONSTRAINT SPR_SR_POSIT_FK');

    FOR row_sp IN (SELECT *
                     FROM sr_posit sp)
    LOOP
    
        l_id_positioning   := seq_positioning.nextval;
        l_desc_positioning := 'POSITIONING.CODE_POSITIONING.' || l_id_positioning;
    
        INSERT INTO positioning
            (id_positioning, code_positioning, rank, flg_available, id_content)
        VALUES
            (l_id_positioning, l_desc_positioning, row_sp.rank, row_sp.flg_available, row_sp.id_content);
    
        pk_translation.upd_code_translation(cur_code_trl => row_sp.code_sr_posit, new_code_trl => l_desc_positioning);
    
        FOR row_spis IN (SELECT *
                           FROM sr_posit_instit_soft spis
                          WHERE spis.id_sr_posit = row_sp.id_sr_posit)
        LOOP
        
            INSERT INTO positioning_instit_soft
                (id_positioning_instit_soft,
                 id_positioning,
                 id_institution,
                 id_software,
                 flg_available,
                 rank,
                 posit_type)
            VALUES
                (seq_positioning_instit_soft.nextval,
                 l_id_positioning,
                 row_spis.id_institution,
