-- CHANGED BY: Diogo Oliveira
DECLARE
    CURSOR c_doc_ext IS
        WITH conversion_table AS
         (SELECT id_lang, id_iso
            FROM (SELECT t.column_value AS id_lang, rownum AS rn
                    FROM TABLE(table_number(19, 7, 10, 9, 11, 1, 3, 4, 5, 2, 8, 6, 18, 16, 17, 20, 21, 22, 12, 13, 14, 15)) t) t_lang
            JOIN (
                 
                 SELECT t.column_value AS id_iso, rownum AS rn
                   FROM TABLE(table_number(122,
                                            35,
                                            100,
                                            30,
                                            122,
                                            122,
                                            36,
                                            108,
                                            66,
                                            35,
                                            35,
                                            44,
                                            44,
                                            36,
                                            36,
                                            7,
                                            26,
                                            122,
                                            173,
                                            173,
                                            68,
                                            127)) t) t_iso
              ON t_iso.rn = t_lang.rn)
        SELECT de.id_doc_external, de.id_language, ct.id_iso
          FROM doc_external de
          JOIN conversion_table ct
            ON ct.id_lang = de.id_language
         WHERE de.id_language IS NOT NULL;

    l_row c_doc_ext%ROWTYPE;

BEGIN
    OPEN c_doc_ext;

    LOOP
        FETCH c_doc_ext
            INTO l_row;
        EXIT WHEN c_doc_ext%NOTFOUND;
    
        UPDATE doc_external de
           SET de.id_language = l_row.id_iso
         WHERE de.id_doc_external = l_row.id_doc_external;
    
    END LOOP;

    CLOSE c_doc_ext;
END;
/

DECLARE
    CURSOR c_doc_ext_hist IS
        WITH conversion_table AS
         (SELECT id_lang, id_iso
            FROM (SELECT t.column_value AS id_lang, rownum AS rn
                    FROM TABLE(table_number(19, 7, 10, 9, 11, 1, 3, 4, 5, 2, 8, 6, 18, 16, 17, 20, 21, 22, 12, 13, 14, 15)) t) t_lang
            JOIN (
                 
                 SELECT t.column_value AS id_iso, rownum AS rn
                   FROM TABLE(table_number(122,
                                            35,
                                            100,
                                            30,
                                            122,
                                            122,
                                            36,
                                            108,
                                            66,
                                            35,
                                            35,
                                            44,
                                            44,
                                            36,
                                            36,
                                            7,
                                            26,
                                            122,
                                            173,
                                            173,
                                            68,
                                            127)) t) t_iso
              ON t_iso.rn = t_lang.rn)
        SELECT deh.id_doc_external_hist, deh.id_language, ct.id_iso
          FROM doc_external_hist deh
          JOIN conversion_table ct
            ON ct.id_lang = deh.id_language
         WHERE deh.id_language IS NOT NULL;

    l_row c_doc_ext_hist%ROWTYPE;

BEGIN
    OPEN c_doc_ext_hist;

    LOOP
        FETCH c_doc_ext_hist
            INTO l_row;
        EXIT WHEN c_doc_ext_hist%NOTFOUND;
    
        UPDATE doc_external_hist deh
           SET deh.id_language = l_row.id_iso
         WHERE deh.id_doc_external_hist = l_row.id_doc_external_hist;
    
    END LOOP;

    CLOSE c_doc_ext_hist;
END;
/
-- CHANGE END: Diogo Oliveira

