DECLARE
    CURSOR c_hist IS
        SELECT s.id_schedule
          FROM schedule_hist s
         WHERE s.id_schedule_hist IS NULL
         ORDER BY s.id_schedule;

    l_id_schedule schedule.id_schedule%TYPE;
BEGIN
    OPEN c_hist;
    LOOP
        FETCH c_hist
            INTO l_id_schedule;
        EXIT WHEN c_hist%NOTFOUND;
    
        UPDATE schedule_hist s
           SET s.id_schedule_hist = seq_schedule_hist.nextval
         WHERE s.id_schedule = l_id_schedule;
    END LOOP;
    CLOSE c_hist;
END;
/
-- CHANGE END: Diogo Oliveira

-- CHANGED BY: Diogo Oliveira
DECLARE
    CURSOR c_hist IS
        SELECT s.id_schedule
          FROM schedule_hist s
         WHERE s.dt_schedule_hist IS NULL
         ORDER BY s.id_schedule;

    l_id_schedule schedule.id_schedule%TYPE;
BEGIN

    OPEN c_hist;
    LOOP
        FETCH c_hist
            INTO l_id_schedule;
        EXIT WHEN c_hist%NOTFOUND;
    
        UPDATE schedule_hist s
           SET s.dt_schedule_hist = s.create_time
         WHERE s.id_schedule = l_id_schedule;
    END LOOP;
    CLOSE c_hist;

END;
/
-- CHANGE END: Diogo Oliveira
